import React from "react";

function Col(props) {
  const size = props.size
    .split(" ")
    .map((size) => "col-" + size)
    .join(" ");

  return (
    <div
      className={size}
      {...props}
      // style={{ backgroundImage: props.backgroundImage }}
    />
  );
}

export default Col;
